import React from 'react';
// styles.
import '../styles/categoryItem.scss';

const CategoryItem = ({imageUrl, name, price}) => (
    <div className="category-item">
        <div className="image">

        </div>
        <img src={imageUrl} alt={name} />
        <button>ADD TO CART</button>
        <p>{name}</p>
        <p>{`$${price}.00`}</p>
    </div>
);

export default CategoryItem;
